import React from "react";
import Link from "next/link";

import Logo from "../../assets/dblogo";
import Github from "../../assets/github";
import LinkedIn from "../../assets/linkedin";
import Twitter from "../../assets/twitter";

import { Grid, Typography } from "@material-ui/core";

import withStyles from "./styles";

class Navbar extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <Grid container className={classes.container}>
        <Grid item xs={4} className={classes.logoContainer}>
          <Link href="/">
            <Logo className={classes.logo} />
          </Link>
        </Grid>
        <Grid item xs={4} className={classes.siteLinks}>
          <Link href="/about">
            <Typography className={classes.link}>about</Typography>
          </Link>
          <Link href="/experience">
            <Typography className={classes.link}>experience</Typography>
          </Link>
          <Link href="/work">
            <Typography className={classes.link}>work</Typography>
          </Link>
          <Link href="/contact" className={classes.link}>
            <Typography className={classes.link}>contact</Typography>
          </Link>
        </Grid>
        <Grid item xs={4} className={classes.socialLinks}>
          <a
            href="https://www.linkedin.com/in/drew-blincoe-007b06b4/"
            target="_blank"
          >
            <LinkedIn className={classes.svgIcon && classes.link} />
          </a>
          <Github className={classes.svgIcon && classes.link} />
          <a href="https://twitter.com/BlincoeDrew?lang=en" target="_blank">
            <Twitter className={classes.svgIcon && classes.link} />
          </a>
        </Grid>
      </Grid>
    );
  }
}

export default withStyles(Navbar);
